import logo from "./logo.svg";

function isolations(){
    return [
        {
            id: 1,
            title: "ultracentrifugation",
            completed: false,
        },
        {
            id: 2,
            title: "density gradient",
            completed: false,
        },
        {
            id: 3,
            title: "size exclusion chromatography",
            completed: false,
        }
    ]
}

function App() {
    const methods = isolations();
    return (
        <>
            <ul>
                {methods.map((method) => (
                    <InputGroup key={method.id}>
                                <InputGroup.Checkbox checked={method.completed} />
                        <FormControl
